import React from "react";

const MyProfile = () => {
  return (
    <div className="min-h-screen bg-gray-100 pt-24">
      <div
        className="w-full h-56 bg-cover bg-center flex items-center justify-center text-white text-3xl font-bold shadow"
        style={{
          backgroundImage:
            "url('https://images.unsplash.com/photo-1529626455594-4ff0802cfb7e?auto=format')",
        }}
      >
        My Dashboard
      </div>

      <div className="max-w-4xl mx-auto mt-8 bg-white p-6 rounded-xl shadow-lg">
        <h2 className="text-xl font-semibold mb-2">My Profile</h2>
        <p className="text-gray-600">Your profile details will appear here.</p>
      </div>
    </div>
  );
};

export default MyProfile;
